CREATE TABLE IF NOT EXISTS room(
	room_id integer NOT NULL PRIMARY KEY,
	room_type_id integer,
	room_floor integer,
	availability boolean DEFAULT TRUE,
	hotel_id integer,
    created_at timestamp NOT NULL DEFAULT NOW()
);

CREATE TABLE IF NOT EXISTS customer(
	customer_id SERIAL NOT NULL PRIMARY KEY,
	first_name varchar(100) NOT NULL,
	last_name varchar(100),
	email varchar(100) UNIQUE NOT NULL,
	phone varchar(100),
	UNIQUE(first_name, last_name),
    created_at timestamp NOT NULL DEFAULT NOW()
);

CREATE TABLE IF NOT EXISTS reservation(
	reservation_id integer NOT NULL PRIMARY KEY,
	customer_id integer NOT NULL REFERENCES customer(customer_id),
	reservation_date timestamp, 
	start_date timestamp,
	end_date timestamp,
	total_price numeric,
	review varchar,
	rating int,
    created_at timestamp NOT NULL DEFAULT NOW()
);

CREATE TABLE IF NOT EXISTS reservation_room(
	reservation_room_id SERIAL NOT NULL PRIMARY KEY,
	reservation_id integer NOT NULL REFERENCES reservation(reservation_id),
	room_id integer NOT NULL REFERENCES room(room_id),
    created_at timestamp NOT NULL DEFAULT NOW()
);

CREATE TABLE IF NOT EXISTS payment(
	payment_id integer NOT NULL PRIMARY KEY,
	reservation_id integer UNIQUE NOT NULL REFERENCES reservation(reservation_id),
	provider varchar(100),
	account_number varchar(100),
	payment_status varchar(20),
	payment_date timestamp,
	expire_date timestamp,
    created_at timestamp NOT NULL DEFAULT NOW()
);





